import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
  paper: {
    maxWidth: 1200
  },
});

function createData(number, name, description, price, stock, protein) {
  return {number, name, description, price, stock, protein };
}

const rows = [
  createData(1, 'Wind Turbine: V236-15.0 MW ', 'The V236-15.0 MW is built with the industry’s largest swept area and a capacity factor of over 60% from the 115.5m blades.', "5,000,000", 24, 4.0),
  createData(2, 'Solar Panel: ARTsolar – 370 Watt', "72 cell monocrystalline percium solar module with improved lifespan and efficiency with mono percium cells.", "2,021", 37, 4.3),
  createData(3, 'Crop sprayer drone','6Axis agriculture drone with a 1650mm UAV drone frame and a 15L capacity tank', "18,366", 24, 6.0),
  createData(4, 'Cupcake', 305, 3.7, 67, 4.3),
  createData(5, 'Gingerbread', 356, 16.0, 49, 3.9),
];

export default function BasicTable() {
  const classes = useStyles();

  return (
      <Grid container justify="center" alignItems="center">
          <TableContainer component={Paper} className={classes.paper}>
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Number</TableCell>
            <TableCell>Service/Product</TableCell>
            <TableCell>Description</TableCell>
            <TableCell align="right">Price&nbsp;(R)</TableCell>
            <TableCell align="right">Stock/Avaliability&nbsp;</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.number}>
              <TableCell component="th" scope="row">
                {row.number}
              </TableCell>
              <TableCell>{row.name}</TableCell>
              <TableCell>{row.description}</TableCell>
              <TableCell align="right">{row.price}</TableCell>
              <TableCell align="right">{row.stock}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
      </Grid>

  );
}
